const links = []
for(let i = str.length-1; i >= 5; i--) {
    if(
        str[i] == 'p'
        && str[i-1] == 'b'
        && str[i-2] == 'e'
        && str[i-3] == 'w'
        && str[i-4] == '.'
    ) {
        let link = ''
        let j = i;
        while(!(
            str[j] == '/'
            && str[j-1] == '_'
            && str[j-2] == '/'
        )) {
            link += str[j]
            j--;
        }
        link = 'https://tlgrm.eu/_/' + link.split('').reverse().join('')
        links.push(link)
    }
}
// filtering
const res = [];
for(let i = 0; i < links.length; i+=4) {
    res.push(links[i])
}
const json = {
    stickers: res
}
fs.writeFile('sticks.json', JSON.stringify(json), (err) => {
  if (err) throw err;
  console.log('The file has been saved!');
})